import React from 'react'
import { Jumbotron } from 'react-bootstrap'

function Home() {
  return (
    <div>
      <Jumbotron className="text-center">
        <h1>Welcome to Admin Dashboard</h1>
      </Jumbotron>
    </div>
  )
}

export default Home
